import { FaSearch } from 'react-icons/fa'
import './App.css';


function App() {
  return (
    <div>
      <div id="search-bar">
        <input type="text" id="search-input"></input>
        <button onClick={search}><FaSearch /></button>
      </div>
      <div id="select-bar">
        <button> Google </button>
        <button> Baidu </button>
        <button> Yahoo </button>
        <button> Bing </button>
      </div>
    </div>
  );
}


function search() {
  var myQuery = window.encodeURI(document.getElementById('search-input').value)
  console.log(myQuery);
  if (myQuery != '') {
    window.location.assign("https://www.google.com/search?q=" + myQuery);
  }
}

export default App;
